# 1 "CLex.fsl"
 
  (* File MicroC/CLex.lex
     Lexer specification for micro-C, a small imperative language
   *)

// module CLex =

open FSharp.Text.Lexing
open CPar;

let lexemeAsString lexbuf = 
     LexBuffer<char>.LexemeString lexbuf

 (* Scan keywords as identifiers and use this function to distinguish them. *)
 (* If the set of keywords is large, use a hashtable instead.               *)

let keyword s =
     match s with
     | "else"    -> ELSE
     | "false"   -> CSTBOOL 0
     | "if"      -> IF
     | "null"    -> NULL
     | "print"   -> PRINT
     | "println" -> PRINTLN
     | "return"  -> RETURN
     | "true"    -> CSTBOOL 1
     | "void"    -> VOID 
     | "while"   -> WHILE 
     | "do"      -> DO 
     | "done"    -> DONE
     | "until"   -> UNTIL
     | "for"     -> FOR  
     | "switch"  -> SWITCH
     | "case"    -> CASE
     | _         -> NAME s

let keyword2 s2 =
     match s2 with
     | "Char"    -> CHAR 
     | "Int"     -> INT   
     | _         -> failwith "Lexer error: not exist this type"

let cEscape s = 
     match s with 
     | "\\\\" -> '\\'
     | "\\\"" -> '\"'
     | "\\a"  -> '\007'
     | "\\b"  -> '\008'
     | "\\t"  -> '\t'
     | "\\n"  -> '\n'
     | "\\v"  -> '\011'
     | "\\f"  -> '\012'
     | "\\r"  -> '\r'
     | _      -> failwith "Lexer error: impossible C escape"
 
